function MembershipRows({key, gym, tier, name, email, phone, attached_member, setMemberships, memberships}) {

  function deleteMembership () {
    fetch(`/memberships/${key}`, { method: 'DELETE' })
      .then(setMemberships(memberships))
  }

    return (
      <tr className="table-row">
          <td className="gym">{gym}</td>
          <td className="tier">{tier}</td>
          <td className="name">{name}</td>
          <td className="email">{email}</td>
          <td className="phone">{phone}</td>
          <td className="additional-members">{attached_member}</td>
          <button type="submit" onClick={(key)=> deleteMembership}><i class="trash icon"></i></button>
      </tr>
    )
  }

  export default MembershipRows
